overeignty, imposed strict controls over everyday life and cost the lives of tens of millions of people. After 1978, his successor DENG Xiaoping and other leaders focused on market-oriented economic development and by 2000 output had quadrupled. For much of the population, living standards have improved dramatically and the room for personal choice has expanded, yet political controls remain tight.",hte='For input string: "',Rbe='For record:',Jbe='Form was unable to be submitted. The most likely cause for this is an invalid value in an upload field.',oNe='FormErrorOrientation',pNe='FormErrorOrientation;',kDe='FormHandlerCollection',lDe='FormHandlerCollection;',qNe='FormItemType',rNe='FormItemType;',sNe='FormLayoutType',tNe='FormLayoutType;',uNe='FormMethod',vNe='FormMethod;',mDe='FormPanel',pDe='FormPanel$1',nDe='FormPanel$SubmitCompleteEvent',oDe='FormPanel$SubmitEvent',$Ed='FormPanel_',UMd='Founded in the 12th century, the Principality of Muscovy, was able to emerge from over 200 years of Mongol domination (13th-15th centuries) and to gradually conquer and absorb surrounding principalities. In the early 17th century, a new Romanov Dynasty continued this policy of expansion across Siberia to the Pacific. Under PETER I (ruled 1682-1725), hegemony was extended to the Baltic Sea and the country was renamed the Russian Empire. During the 19th century, more territorial acquisitions were made in Europe and Asia. Repeated devastating defeats of the Russian army in World War I led to widespread rioting in the major cities of the Russian Empire and to the overthrow in 1917 of the imperial household. The Communists under Vladimir LENIN seized power soon after and formed the USSR. The brutal rule of Iosif STALIN (1928-53) strengthened communist rule and Russian dominance of the Soviet Union at a cost of tens of millions of lives. The Soviet economy and society stagnated in the following decades until General Secretary Mikhail GORBACHEV (1985-91) introduced glasnost (openness) and perestroika (restructuring) in an attempt to modernize Communism, but his initiatives inadvertently released forces that by December 1991 splintered the USSR into Russia and 14 other independent republics. Since then, Russia has struggled in its efforts to build a democratic political system and market economy to replace the strict social, political, and economic controls of the Communist period. While some progress has been made on the economic front, recent years have seen a recentralization of power under Vladimir PUTIN and the erosion of nascent democratic institutions. A determined guerrilla conflict still plagues Russia in Chechnya and threatens to destabilize the North Caucasus region.',EMd='France',sce='Freeze',tce='Freeze on left',uce='Freeze on right',FYd='French Guiana',GYd='French Polynesia',HYd='French Southern Territories',gAd='Fri',tAd='Friday',LQd='Friends Fianance Goals',CRd='Friendships',rbe='From',_ae='From must be before To',mee='Full justify selection',oTd='Fun',SKd='Fun Activity',nhe='GENERIC',fyd='GET',Zge='GETPARAMS',wBd='GIF',uMd='GM',Ayd='GMT',cWd='GOAL TYPE: ',kBd='GRAYSCALE',Cne='GREATER_OR_EQUAL',voe='GREATER_OR_EQUAL_FIELD',yne='GREATER_THAN',roe='GREATER_THAN_FIELD',iHd='GREEN',pne='GRID',IYd='Gabon',JYd='Gambia',CFe='GeoMap$DataMode',DFe='GeoMap$DataMode;',KYd='Georgia',tMd='Germany',LYd='Ghana',MYd='Gibraltar',OTd='Give Deals',JJe='GiveADealView',KJe='GiveADealView$1',LJe='GiveADealView$2',MJe='GiveADealView$3',NJe='GiveADealView$4',OJe='GiveADealView$5',EId='Goal Achievement Action Plan',IUd='Goal End Date',ZVd='Goal End Date is before Goal Start Date',pLd='Goal GodMom/Dad',HUd='Goal Start Date',PJe='GoalStatus',QJe='GoalStatus;',vKd='Grade A',wKd='Grade A -',xKd='Grade B',yKd='Grade B -',zKd='Grade C',AKd='Grade C -',gXd='Graduate School',DMd="Great Britain, the dominant industrial and maritime power of the 19th century, played a leading role in developing parliamentary democracy and in advancing literature and science. At its nesia is the world's largest archipelagic state and home to the world's largest Muslim population. Current issues include: alleviating poverty, preventing terrorism, consolidating democracy after four decades of authoritarianism, implementing financial sector reforms, stemming corruption, and holding the military and police accountable for human rights violations. Indonesia was the nation worst hit by the December 2004 tsunami, which particularly affected Aceh province causing over 100,000 deaths and over $4 billion in damage. An additional earthquake in March 2005 created heavy destruction on the island of Nias. Reconstruction in these areas may take up to a decade. In 2005, Indonesia reached a historic peace agreement with armed separatists in Aceh, but it continues to face a low intensity separatist guerilla movement in Papua.",rMd='The Indus Valley civilization, one of the oldest in the world, dates back at least 5,000 years. Aryan tribes from the northwest infiltrated onto Indian lands about 1500 B.C.; their merger with the earlier Dravidian inhabitants created the classical Indian culture. Arab incursions starting in the 8th century and Turkish in the 12th were followed by those of European traders, beginning in the late 15th century. By the 19th century, Britain had assumed political control of virtually all Indian lands. Indian armed forces in the British army played a vital role in both World Wars. Nonviolent resistance to British colonialism led by Mohandas GANDHI and Jawaharlal NEHRU brought independence in 1947. The subcontinent was divided into the secular state of India and the smaller Muslim state of Pakistan. A third war between the two countries in 1971 resulted in East Pakistan becoming the separate nation of Bangladesh. Despite impressive gains in economic investment and output, India faces pressing problems such as the ongoing dispute with Pakistan over Kashmir, massive overpopulation, environmental degradation, extensive poverty, and ethnic and
